Promover a disseminação de conhecimento sobre melhores práticas empresariais nos canais da Rede CEME de informação (site, revista, informativo, grupo de discussão, redes sociais, etc). A ação tem o objetivo de estimular o desenvolvimento de empresas mais inteligentes e competitivas por meio do adequado tratamento da gestão de conhecimento, considerando:
- Registros de experiências (vídeos, depoimentos, casos, apresentações, etc) de empresárias que tiveram êxito com sua participação no Programa Empreender;
- Criação de um banco de palestrantes participantes do movimento associativista;
- Elaboração de materiais informativos que estimulem a capacidade empreendedora, capacidade de gestão e motivação para inovação nas empresas;
- Ampla divulgação das atividades e resultados alcançados com as ações do projeto.

Fomentar o estabelecimento de alianças estratégicas para o desenvolvimento  das mulheres empresárias do Estado de Santa Catarina. A ação prevê:
- Mapeamento de instituições públicas e privadas, em âmbito municipal, estadual ou federal com potencial para apoiar ações ligadas ao desenvolvimento das mulheres empresárias;
- Aproximação e estreitamento de relacionamentos para alianças (reuniões de alinhamento com instituições, buscando parcerias para o desenvolvimento de políticas públicas e projetos par o fortalecimento das mulheres empresárias);
- Elaboração de instrumentos (projetos, protocolos, acordos, etc) conforme alinhamentos estabelecidos;
- Elaboração de modelos de projetos, alinhados às diretrizes do CEME, para disseminação entre os núcleos, visando o apoio das instituições locais, como prefeituras, secretarias de desenvolvimento ou outras.

A ação compreende a introdução de melhorias no Portal do EMPREENDER nas áreas abaixo indicadas, de modo a ampliar os controles de acompanhamento dos projetos assim como facilitar o acesso às diferentes facilidades pelos usuários em geral.

As principais alterações são:

•	Área externa - acessível pelos internautas sem necessidade de identificação 
•	Facilidades de gerenciamento de conteúdo a ser realizado sem a interferência da equipe de desenvolvimento. Assim, dá-se agilidade ao portal para a divulgação de informações de interesse do EMPREENDER a todos os interessados;
•	Área interna – acessível apenas mediante a identificação do usuário
•	Facilidades de gerenciamento de conteúdo para a divulgação de informações de interesse específico dos usuários cadastrados;
•	Nova estrutura de direitos com uma definição detalhada das ações permitidas para cada usuário facilitando as atividades das federações, ACEs, núcleos e parceiros dos projetos e o próprio Sebrae que atualmente tem acesso precário;
•	Melhorias no acompanhamento financeiro facilitando a interação entre a coordenação e os gestores de projeto;
•	Melhorias no acompanhamento técnico dos projetos;
•	Melhorias no acompanhamento das ações desenvolvidas nos núcleos setoriais;
•	Melhorias na qualidade das informações mantidas e nas formas de recuperação, incluindo consultas e relatórios;
•	Novo módulo de projetos, capaz de permitir a administração de diferentes tipos de projetos como o Empreender Competitivo e a expansão de núcleos, entre outros;
•	Reformulação dos cadastros de modo a permitir a manutenção de informações adicionais e eliminando limitações hoje existentes. Fusão dos cadastros de ACEs e Federações em um novo cadastro de entidades, dando maior abrangência ao portal;
•	Criação de alertas para os usuários segundo seus direitos de uso, facilitando o acompanhamento de projetos;
•	Criação de registro das atividades dos usuários (jornal), permitindo a solução de eventuais problemas e a identificação de responsáveis pelas alterações nas informações
•	Ferramentas para coordenação
•	Novo esquema de vinculação de núcleos a entidades coordenadoras

Desenvolvimento e aplicação de pesquisa que visa traçar o perfil de empresas (dirigidas por mulheres) e empreendedoras que fazem parte do movimento associativista no Brasil. O objetivo é conhecer características e desafios das donas dos pequenos negócios na participação e ascensão em cargos de lideranças em Instituições de classe. A pesquisa levantará informações que contribuem para a assertividade na implementação das outras ações propostas neste projeto. Alguns dos temas abordados serão:
•	Características da empreendedora e do negócio;
•	Necessidades e desafios empresariais;
•	Necessidades e desafios pessoais;
•	Participação x protagonismo na sociedade; 
•	Liderança de entidades de classe.

O programa de formação de Liderança Feminina será construído com um design inovador e sob medida para as mulheres que buscam protagonismo no mundo empresarial, institucional e sociedade. Apoiada por uma metodologia que mescla conceito e prática, o programa prevê três módulos com conteúdo que geram contribuições efetivas no desenvolvimento das empresas participantes por meio da melhoria de competências de suas líderes. Abaixo detalhe de alguns temas relevantes a serem abordados dentro dos módulos.
•	Módulo I (Sensibilização – Conceito -  Planejamentos)
o	Avaliação Perfil de liderança (aplicação de teste – pré-workshop);
o	Liderança feminina contemporânea x Impactos positivos na sociedade;
o	Sororidade como fio condutor para ampliação do trabalho nos estados;
o	Liderança e engajamento de pessoas;
o	Promoção da igualdade de gênero e o empoderamento de todas as mulheres
o	Definição de objetivos de protagonismo (empresa/instituição/sociedade).

•	Módulo II (Atendimento individual - online):
o	Feedback direcionado – Avaliação perfil;
o	Alinhamento do perfil x objetivos estabelecidos;
o	Criação de Mapa Estratégico individual.
o	Mentoria para desenvolvimento de habilidades.

•	Módulo III (Conceitos, transformações e compartilhamento de ganhos)
o	A arte de liderar líderes;
o	Líder - Códigos de conduta nos mais diversos ambientes;
o	Rede de Relacionamento como ferramenta de desenvolvimento de negócios e alcance de resultados;
o	Melhoria da Liderança e empoderamento pela comunicação.

Organização de Missão Internacional com os seguintes objetivos:
•	Compreensão e experimentação quanto aos mecanismos que fazem de alguns países líderes mundiais do ranking de igualdade de gênero;
•	Conhecimento de estratégias/projetos inovadores implementadas por empresas lideradas por mulheres;
•	Ampliação de visão de mercado para pequenos negócios - Possibilidade de participação em feira multissetorial.

Para a definição do destino, deve-se levar em consideração:
1.	Possibilidades de parcerias e estabelecimentos de alianças estratégias;
2.	Países com melhores índices de igualdade de gênero;
3.	Valores custo x benefício/participante.

Importante: O destino será definido pela Diretoria do CNME, com base no estudo de alguns aspectos mencionados acima. 
Atualmente, todos os países que apresentam esta condição estão localizados na Europa. São eles: França, Alemanha, Portugal e Espanha.

