Desenvolvimento do primeiro Jardim Vertical acessível para a população em Florianópolis, com coleta de água da chuva; irrigação automática; e utilização de espécies nativas. 
O propósito é: 
- reduzir os efeitos das ilhas de calor dos centros urbanos e da poluição atmosférica; 
- limpar o ar externo de poluentes e poeira, também ajudando a neutralizar os índices de carbono resultantes das emissões de combustíveis;
- melhorar, por meio das plantas, a qualidade do ar e atuar como uma barreira natural de isolamento acústico; 
-  aumentar a biodiversidade criando habitats para aves e insetos; 
- Redução do estresse, proporcionando bem estar aos seres humanos;
- organizar a paisagem urbana, minimizando as pichações;
- fornecer benefícios econômicos aumentando o fluxo de pedestre em espaços comerciais; e
- criar empregos, pois requerem mão de obra de uma série de áreas, como arquitetos, paisagistas consultores de irrigação entre outros.

