O atendimento às demandas identificadas se dá na forma de projetos simplificados. 

A proposição destas demandas será de modo contínuo ao longo do projeto, tendo como base a publicação de chamada de proposta com prazo amplo. As demandas são analisadas à medida em que são apresentadas 

As demandas apresentadas podem ou não estar ligadas a outras iniciativas do Sebrae, e poderão ser atendidas diretamente pela CACB ou por meio de conselhos vinculados como o Jovem Empresário e a Mulher Empresária.

De modo mais específico, as demandas devem conter pelo menos alguma das características a seguir:

A.	Ações que contribuam para o desenvolvimento das capacidades de gestão empresarial contemplando capacitações de diretores, gestores e colaboradores;
B.	Ações que contribuam para o aumento do mercado alcançado pelas empresas participantes;
C.	Ações de melhoria de processos de produção, comercialização, gestão administrativa, financeira e de recursos humanos;
D.	Ações de melhoria de produtos e serviços, implementação de novas técnicas;
E.	Ações de inovação e implementação de boas práticas e certificações de qualidade, gestão ambiental e responsabilidade social corporativa (RSC);
F.	Ações que aumentem a produtividade incluindo a utilização de recursos energéticos e hídricos.

