Essa consultoria tem como objetivo o desenvolvimento de um novo produto tanto para o mercado interno quanto para o mercado externo. Algumas empresas já estão se preparando para exportar e essa consultoria em desenvolvimento de novo produto vem para ajudá-los a identificar qual melhor produto e a viabilidade do mesmo.

A consultoria contempla: 

- Estudo preliminar;
- Levantamento das necessidades e exigências das empresas e/ou objetivos; - descrição da função que o produto terá, atividade que irá abrigar, padrões de qualidade; 
- A elaboração desse programa deve, necessariamente, proceder ao início do projeto, podendo ser complementado ao longo do seu desenvolvimento;
- Apresentação dos primeiros estudos para avaliação e possíveis modificações;
- Assinatura de conclusão da etapa.

O benchmarking é uma das ferramentas mais importantes para sobrevivência e crescimento das organizações. Com ele, atividades bem-sucedidas são tomadas como referência, e suas práticas viram padrões a serem seguidos, por quem deseja evoluir em um segmento comparável. O processo é dividido em 4 etapas:

• Planejamento: definir as atividades comparáveis da empresa, as organizações que servem de referência e a metodologia de comparação;
• Análise: avaliar a referência e entender quão distante está da excelência de mercado;
• Integração:  absorver os resultados internamente, definindo metas e projetos para melhoria;
• Ações: implementar as medidas corretivas.

Nesse sentido as empresas realizarão um circuito de benchmarking durante três dias, realizando visitas estratégicas em quatro grandes empresas (IBM, Amazon, Nubank e Natura) de São Paulo.

O PDG, consiste em uma abordagem em 8 frentes, sendo elas:

- Custos, metas e desvio de escopo (para que possamos precificar com qualidade e não fazer ou refazer sem receber);

Seleção de mercado (a partir do escritório, o curso irá ajudar a direcionar a atuação para um ou dois segmentos, preferencialmente);
- Análise dos pontos fortes e fracos da estrutura atual, para atuar nos mercados selecionados e identificar potenciais pontos de melhoria, oferecendo referência para o desenvolvimento;
- Plataforma de serviços e organização da equipe.

O curso tem como objetivo, orientar os empresários em um programa de gestão totalmente voltado para a arquitetura. Abordando especificamente as demandas específicas na área. 

Será desenvolvido como workshops para todo o grupo, e posteriormente um acompanhamento individual sobre a implementação do programa ensinado. 

Prevê-se 150 horas de elaboração, preparação, execução e acompanhamento do programa.

Consultoria Jurídica Grupal Contratual e Trabalhista

A consultoria jurídica, abordará duas frentes importante no escritório de arquitetura. 

Os empresários irão através desta consultoria, elaborar um contrato base genérico para utilizarem com seus clientes. Este contrato tem por objetivo prevenir os arquitetos de prejuízos e obrigações não coerentes com o projeto entregue. O contrato tem o formato mais jurídico, fazendo o alinhamento das responsabilidades de ambas as partes. É um documento que traz segurança do que o prestador de serviço está oferecendo, e o cliente também tem as suas responsabilidades, oferecendo para os dois lados, tanto para assegurar o arquiteto/ design de interiores como para garantir os direitos do cliente.

Outra frente abordada será na esfera do direito trabalhista. Será efetuada uma asseria grupal sanando as principais dúvidas quanto á contrato de trabalho, como também os cuidados que devem ser tomados durante a relação de emprego, como:

- Caracterização de vínculo empregatício;
- Horas extras;
- Verbas rescisórias;
- Contrato de trabalho temporário;
- Intervalos interjornada e intrajornada;
- Caracterização de assédio.

O objetivo principal desta ação, é prevenir os empresários de possíveis processos jurídicos. Através do conhecimento prévio da legislação e as regras previstas, o empresário poderá se anteceder, evitando assim, custos altos com jurídico e a justiça. Além de garantir um bom funcionamento do escritório, otimizando o tempo do empresário.

O desenvolvimento da consultoria acontecerá em reuniões grupais, ouvindo as dúvidas e experiências vivenciadas, para o advogado efetuar a elaboração do contrato de prestação de serviços, assim como sanar todas as questões trabalhistas. Após a finalização das duas frentes selecionadas, o profissional jurídico realiza ainda, um acompanhamento afim de garantir que os empresários alcancem o resultado esperado.

Prevê-se 59 horas de elaboração, preparação, execução e acompanhamento do programa.
